//SPDX-License-Identifier: MIT
pragma solidity ^0.8.7;

contract Timelockwallet {

    struct Deposit{
        uint start;
        uint end;
        uint balance;
    }

    mapping(address => Deposit) public deposits;

    function save(uint _end) external payable {
        require(msg.value != 0, "You need to provide a balance");
        deposits[msg.sender].balance += msg.value;
        deposits[msg.sender].start = block.timestamp;
        deposits[msg.sender].end = block.timestamp + _end;
    }

    function modify(uint _newEnd) external payable {
        require(deposits[msg.sender].end > block.timestamp, "Times already up, use save option");
        deposits[msg.sender].end += _newEnd;
        deposits[msg.sender].balance += msg.value;
    }

    function withdraw() external payable {
        require(deposits[msg.sender].end < block.timestamp, "Too early to withdraw");
        uint amount = deposits[msg.sender].balance;
        deposits[msg.sender].balance = 0;

        payable(msg.sender).transfer(amount);
    }

    function getTime() external view returns(uint) {
        uint timeLeft = deposits[msg.sender].end - block.timestamp;        
        return timeLeft;
    }

    function getBalance() external view returns(uint) {
        uint _balance = deposits[msg.sender].balance;
        return _balance;
    }
}
